import React, { useEffect } from 'react'
import { usePokemons } from '../../context/Pokemons/PokemonsContext'
import { queryPokemons } from '../../hooks/query'

export default () => {
  const { data, actions } = usePokemons()

  useEffect(() => {
    actions.getPaginated()
  }, [])

  return (
    <div>
      <h1>HOME</h1>
      {data && data.paginated.paginatedData?.results.map((item) => item.name)}
    </div>
  )
}
